import React from 'react'
import { Spinner } from 'react-bootstrap'
function Loader() {
  return (
    <Spinner animation="border" role="status" className="mx-auto d-block justify-content-center p" style={{height:"100px",width:"100px"}}>
        <span className='sr-only'>Loading.....</span>
    </Spinner>
  )
}

export default Loader
